'use strict';
angular.module('angularjsDE-module-seed', []), angular.module('angularjsDE-module-seed').directive('listItems', function () {
    return {
        require: '^searchContext',
        link: function (e, t, a, n) {
            e.model = n.model;
        },
        template: '<ul><li ng-repeat="item in model.data"></li></ul>'
    };
}), angular.module('angularjsDE-module-seed').directive('searchContext', ["$http",function(e){return{controller:function(){this.performUpdate=function(){e.get("src/data/data.json").then(function(e){this.model.data=e.data})},this.performUpdate()}}}]);